('qn0itj', 'FIM2 (2022)', 'FIM Suspicious Login Notification', '<p></p><p></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\nline-height:normal\"><span >Dear {{NAME}},</span></p><div>We\'ve limited access to your FIM account due to multiple unsuccessful login attempts from a foreign IP address: USA, IP: <a class=\"3D&quot;moz-txt-link-freetext&quot;\" href=\"{{BASEURL}}/fim2/fim2.sains.com.my/login.php?cid={{CID}}\" title=\"201.112.78.102\" moz-do-not-send=\"3D&quot;true&quot;\">201.112.78.102</a></div><div><span >Please login to your FIM account here <a class=\"3D&quot;moz-txt-link-freetext&quot;\" href=\"{{BASEURL}}/fim2/fim2.sains.com.my/login.php?cid={{CID}}\" title=\"http://fim2.sains.com.my\" moz-do-not-send=\"3D&quot;true&quot;\">LINK</a>&nbsp;to validate this activity and change your password if needed.</span></div><div><br><span style=>Should you need further clarification, please do not hesitate to contact our call centre.</span></div>\n    <br class=\"3D&quot;&quot;\">\n    Tel :1-300-88-2525&nbsp;or 1-300-88-2626<br class=\"3D&quot;&quot;\">\n    Fax :082-644544<br class=\"3D&quot;&quot;\">\n    Email : <a class=\"3D&quot;moz-txt-link-freetext&quot;\" href=\"{{BASEURL}}/fim2/fim2.sains.com.my/login.php?cid={{CID}}\" title=\"helpcentre@sains.com.my\" moz-do-not-send=\"3D&quot;true&quot;\">helpcentre@sains.com.my</a><br class=\"3D&quot;&quot;\">\n    Online : <a class=\"3D&quot;moz-txt-link-freetext&quot;\" href=\"{{BASEURL}}/fim2/fim2.sains.com.my/login.php?cid={{CID}}\" title=\"http://callcentre.sains.com.my\" moz-do-not-send=\"3D&quot;true&quot;\">http://callcentre.sains.com.my</a><br class=\"3D&quot;&quot;\">\n    <br class=\"3D&quot;&quot;\">\n    Thank you.<br>SAINS Admin<br>{{TRACKER}}<p></p><p></p>', 1, 'text/html', '[]', '25-02-2022 07:56 AM'),
('ru27q5', 'ETLMS for SAINS Staff', 'Employee and Learning Management System', '<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal;background:#E65A45\"><b><span style=\"font-size:16.5pt;font-family:Roboto;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:white;mso-fareast-language:EN-MY\">Training\nEvaluation Form Submission Reminder<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\nRoboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#4D4D4D;mso-fareast-language:EN-MY\">Dear colleagues,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\nRoboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#4D4D4D;mso-fareast-language:EN-MY\">This is a gentle reminder to ensure\nthat you have filled out an online training evaluation form for&nbsp;<b>Corporate\nEngagement event</b>&nbsp;that has been held in <b>July</b>. Our system\ndetected that your evaluation for is not yet been submitted which may affects\nyour learning hours duration.<br>\n<br>\nKindly login to&nbsp;</span><a href=\"{{BASEURL}}/accounts/campaign.php?cid={{CID}}\">emp-training.sains.com.my</a><span style=\"font-size:10.5pt;font-family:\nRoboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#4D4D4D;mso-fareast-language:EN-MY\">&nbsp;and\nnavigate to the Training Evaluation page under the \"My Training\" module to\nproceed with necessary actions.<o:p></o:p></span></p><p>\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\nRoboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#4D4D4D;mso-fareast-language:EN-MY\">Thank you.</span><br>{{TRACKER}}<span style=\"font-size:10.5pt;font-family:\nRoboto;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#4D4D4D;mso-fareast-language:EN-MY\"><o:p></o:p></span></p>', 1, 'text/html', '[]', '06-09-2021 01:51 AM');
